          "description": "SALADE NIÇOISE\nnot necessarily everything\nEveryone seems to have a very strong opinion as\nSalade Niçoise, so let me tell you from the outsel\nin what I have at home from, broadly, the accepted canon, but not necessarily\nthe purists would. Since the tomatoes we get mostly don't have a lot of flavin\nir, I tend to\nuse those tubs of \"sunblush” tomatoes, and their intense, flavourful acidity work\nhere. I am a great believer in keeping these on hand.\nOtherwise, speed being of the essence, the only real deviation is that I user\ntons (some high-end baked ones from a packet will do) rather than boil potatoes and\nthen have to wait for them to cool.\nIf there's a single recipe that demonstrates what you can make almost exclus.\nively from storecupboard ingredients, then this must be it.\nuse crou-\n2 eggs\n100g frozen green beans\n200g sunblush tomatoes in\nseasoned oil\n100g sliced, stoned black olives\n1 X 225g jar or can excellent tuna\n250g iceberg lettuce pieces\n4 teaspoons extra virgin olive oil\njuice of 1/2 lemon\n1/2 teaspoon Maldon salt or pinch of\ntable salt\n1/2 teaspoon sugar\n4og croutons\n4-6 anchovy fillets (optional)\nsmall handful fresh basil leaves\n1 Put the eggs in a panful of cold water, bring to the boil and let bubble for 7 minutes. Three\nminutes in, add the frozen beans.\n2 Drain both the beans and eggs; let eggs sit in a bowl under running cold water, and hold\nthe beans in a sieve just under the tap for a moment, too, so that eggs and beans stop\ncooking and the beans get cold.\n3 Tip the tomatoes and their oil into a bowl, add the olives and mix gently.\n4 Arrange the lettuce on a serving dish and then top with the tomato-olive mixture, sans\ntheir flavoursome juices in the bowl.\n5 Drain the tuna and place chunks of it along with the tomatoes and olives, then su\nthe drained beans.\nd olives, then strew with\nO Using the reserved juices left in the tomato mixture's bowl, make the dressing\nthe olive oil, lemon juice, salt and sugar and pour over the salad.\nTressing: whisk in\n( Peel and quarter the almost but not quite hard boiled a\nwith\nnilad\no\nled along\n",
